import React, { useEffect } from 'react'
import axios from 'axios'
function Get() {

     
     
     const fetch=()=>{
        axios.get('http://localhost:8000/get')
        .then(res=>console.log(res))
     }

  return (
    <div>
      <button onClick={fetch}>fetch</button>
    </div>
  )
}

export default Get
